window.bookSummaryJSON = "<p>Rejoin Alburet Two-souled as his journey in Alpha World continues. He has two quests that still need to be resolved; one that deals with Nobility, while the other is from the Dark Lord. Before he can deal with either of them, Mindblown brings down the server. As they are about to launch a mass scale immersion testing phase. </p> <p>Gerald, Marysue, Karen, and Fluffball are four of the lucky ones selected for the testing phase. Gerald plans to drum up recruitment for the guild, Alpha Company, during the meet and greet before the immersion testing starts. </p> <p>The quartet of newly minted friends will meet for the first time in the real world. Will they get along or will something force them apart before the game goes back online with them immersed? </p> <p><b>This book contains adult themes.</b> </p>"; 
